import image from '../images/icon-star.svg';

import React from 'react';

import { Questions } from '../components/Questions.jsx';

 export function Container(){
    return (
        <>
       <section className='flex-block items-center justify-left p-[20px] mt-10 bg-white rounded w-fitt max-w-[700px]'> 

        <div className='flex bg-yellow-50'>
        <img src={image} alt="star" className=" w-10 mr-5 bg-red-200"/>
        <h1 className="font-bold text-5xl row-span-1 bg-red-300">FAQs</h1>
        </div>
        <Questions /> 

       </section>

</>
    );
 }
